import axios from "axios";

export const handleEdit = (editingId, formData) => {
    const {API_BASE_URL}= process.env
   return axios.put(`${API_BASE_URL}user/updateUser/${editingId}`, formData)
    .then((data) => {
        return data
    })
    .catch((error) => console.error(error));
};
